import React, { useState } from "react";
import "./CustomerDashboard.css";

const CustomerDashboard = () => {
  const [activeTab, setActiveTab] = useState("submit");
  const [complaintData, setComplaintData] = useState({
    name: "",
    nationalId: "",
    contact: "",
    email: "",
    address: "",
    description: "",
    department: "Select Department",
    urgency: "Normal",
    submittedAt: new Date().toLocaleString(),
  });

  const [complaintId, setComplaintId] = useState("");
  const [complaintStatus, setComplaintStatus] = useState(null);

  const userData = {
    name: "Jane Doe",
    email: "jane@example.com",
    phone: "+9876543210",
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setComplaintData({ ...complaintData, [name]: value });
  };

  const handleSubmitComplaint = (e) => {
    e.preventDefault();
    alert(
      `Complaint submitted:\n${JSON.stringify(complaintData, null, 2)}`
    );
    setComplaintData({
      name: "",
      nationalId: "",
      contact: "",
      email: "",
      address: "",
      description: "",
      department: "Select Department",
      urgency: "Normal",
      submittedAt: new Date().toLocaleString(),
    });
  };

  const handleTrackComplaint = (e) => {
    e.preventDefault();
    setComplaintStatus(
      `Complaint #${complaintId} is currently "In Progress"`
    );
  };

  return (
    <div className="cust-home-page">
      <div className="cust-home-container">
        <h1>Customer Dashboard</h1>

        <div className="cust-btn-group">
          <button
            className={`cust-btn ${
              activeTab === "submit" ? "cust-btn-active" : ""
            }`}
            onClick={() => setActiveTab("submit")}
          >
            Submit Complaint
          </button>
          <button
            className={`cust-btn ${
              activeTab === "track" ? "cust-btn-active" : ""
            }`}
            onClick={() => setActiveTab("track")}
          >
            Track Complaint
          </button>
          <button
            className={`cust-btn ${
              activeTab === "profile" ? "cust-btn-active" : ""
            }`}
            onClick={() => setActiveTab("profile")}
          >
            User Profile
          </button>
        </div>

        <div className="cust-tab-content">
          {/* Submit Complaint Tab */}
          {activeTab === "submit" && (
            <div className="cust-tab-box">
              <h3>Submit Complaint</h3>
              <form onSubmit={handleSubmitComplaint} className="cust-form">
                <input
                  type="text"
                  name="name"
                  placeholder="Name of Citizen"
                  value={complaintData.name}
                  onChange={handleChange}
                  required
                />
                <input
                  type="text"
                  name="nationalId"
                  placeholder="National ID Number"
                  value={complaintData.nationalId}
                  onChange={handleChange}
                  required
                />
                <input
                  type="text"
                  name="contact"
                  placeholder="Contact Number"
                  value={complaintData.contact}
                  onChange={handleChange}
                  required
                />
                <input
                  type="email"
                  name="email"
                  placeholder="Email Address"
                  value={complaintData.email}
                  onChange={handleChange}
                  required
                />
                <input
                  type="text"
                  name="address"
                  placeholder="Address"
                  value={complaintData.address}
                  onChange={handleChange}
                  required
                />
                <textarea
                  name="description"
                  placeholder="Complaint Description"
                  value={complaintData.description}
                  onChange={handleChange}
                  required
                />
                <select
                  name="department"
                  value={complaintData.department}
                  onChange={handleChange}
                  required
                >
                  <option disabled>Select Department</option>
                  <option>Health</option>
                  <option>Education</option>
                  <option>Transport</option>
                  <option>Utilities</option>
                </select>
                <select
                  name="urgency"
                  value={complaintData.urgency}
                  onChange={handleChange}
                  required
                >
                  <option>Normal</option>
                  <option>High</option>
                  <option>Critical</option>
                </select>
                <input
                  type="text"
                  name="submittedAt"
                  value={complaintData.submittedAt}
                  readOnly
                />
                <button type="submit" className="cust-btn-submit">
                  Submit
                </button>
              </form>
            </div>
          )}

          {/* Track Complaint Tab */}
          {activeTab === "track" && (
            <div className="cust-tab-box">
              <h3>Track Complaint</h3>
              <form onSubmit={handleTrackComplaint} className="cust-form">
                <input
                  type="text"
                  placeholder="Enter Complaint ID"
                  value={complaintId}
                  onChange={(e) => setComplaintId(e.target.value)}
                  required
                />
                <button type="submit" className="cust-btn-submit">
                  Track
                </button>
                {complaintStatus && (
                  <p className="cust-status">{complaintStatus}</p>
                )}
              </form>
            </div>
          )}

          {/* User Profile Tab */}
          {activeTab === "profile" && (
            <div className="cust-tab-box">
              <h3>User Profile</h3>
              <div className="cust-profile">
                <p>
                  <strong>Name:</strong> {userData.name}
                </p>
                <p>
                  <strong>Email:</strong> {userData.email}
                </p>
                <p>
                  <strong>Phone:</strong> {userData.phone}
                </p>
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default CustomerDashboard;
